import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import NativeSelect from '@material-ui/core/NativeSelect';
import InputBase from '@material-ui/core/InputBase';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import Alert from '@material-ui/lab/Alert';
import { useHistory } from "react-router-dom";
import { assignCurrentUser } from '../actionCreators/actionCreater'
import 'date-fns';
import ReactDOM from "react-dom";
import { MuiPickersUtilsProvider, InlineDatePicker } from "material-ui-pickers";
import DateFnsUtils from "@date-io/date-fns";
import Grid from '@material-ui/core/Grid';

import {
    KeyboardTimePicker,
    KeyboardDatePicker,
} from '@material-ui/pickers';
import { connect } from 'react-redux'
import '../stylesheets/mainPage.css'





const useStyles = makeStyles((theme) => ({
    root: {
        '& .MuiTextField-root': {
            margin: theme.spacing(1),
            width: '25ch',
        },
    },
}));

function AddActivityT(props) {
    let history = useHistory();
    const classes = useStyles();
    const [name, setname] = React.useState('');
    const [activityType, setactivityType] = React.useState('');
    const [image, setimage] = React.useState('');
    const [about, setabout] = React.useState('');
    const [selectedDate, setSelectedDate] = React.useState(new Date('2014-08-18T21:11:54'));
    const [address, setaddress] = React.useState('');
    const [category_id, setcategory_id] = React.useState(1);

    const handleChange1 = (event) => {
        setname(event.target.value);
    };
    const handleChange2 = (event) => {
        setactivityType(event.target.value);
    };
    const handleChange3 = (event) => {
        setimage(event.target.value);
    };
    const handleChange4 = (event) => {
        setabout(event.target.value);
    };

    const handleDateChange = (date) => {
        setSelectedDate(date);
    };
    const handleChange6 = (event) => {
        setaddress(event.target.value);
    };
    const handleChange7 = (event) => {
        setcategory_id(event.target.value);
    };


    // function handleSubmit(event) {

    //     event.preventDefault()
    //     // let data = { username: username, password: password, image: image, city: city }
    //     fetch('http://localhost:3000/signup', {
    //         method: 'POST',
