    //         body: JSON.stringify(data)
    //     }).then(resp => resp.json()).then(response => {
    //         if (response.errors) { alert(response.errors) } else {
    //             props.assignCurrentUser(response)

    //             history.push("/home");
    //             localStorage.user_id = response.id
    //         }
    //     })
    // }
    return (
        <MuiPickersUtilsProvider utils={DateFnsUtils}>
        <div>
            <Alert severity="warning" style={{ textAlign: 'center' }}>Due to Covid-19, Add an activity on your own risk!</Alert>
            <video id='video1' autoPlay muted loop >
                <source src='https://vod-progressive.akamaized.net/exp=1586929622~acl=%2A%2F1698360923.mp4%2A~hmac=2af0e496ee71df1e87710ab0b03e785c9df54655c43dc654abf2159d71998c66/vimeo-prod-skyfire-std-us/01/4710/15/398551000/1698360923.mp4' type='video/mp4' />
            </video>
            <FormControl className={classes.margin}>
                <TextField
                    required
                    id="standard-required"
                    label="name"
                    placeholder='Username'
                    value={name}
                    onChange={handleChange1}
                />
                <TextField
                    required
                    id="standard-required"
                    label="name"
                    type="password"
                    autoComplete="current-password"
                    value={activityType}
                    onChange={handleChange2}
                />
                <TextField
                    required
                    id="standard-required"
                    label="City"
                    placeholder='City'
                    value={image}
                    onChange={handleChange3}
                />
                <TextField
                    required
                    id="standard"
                    label="Image Url"
                    placeholder='Image Url'
                    value={about}
                    onChange={handleChange4}
                />
                <Grid container justify="space-around">
                    <KeyboardDatePicker
                        margin="normal"
                        id="date-picker-dialog"
                        label="Date picker dialog"
                        format="MM/dd/yyyy"
                        value={selectedDate}
                        onChange={handleDateChange}
                        KeyboardButtonProps={{
                            'aria-label': 'change date',
                        }}
                    />
                </Grid>
                <NativeSelect
                    id="demo-customized-select-native"
                    placeholder='Select Category'
                    value={category_id}
                    onChange={handleChange7}
                >
                    <option aria-label="None" value="" />
                    <option value={1}>Sorts</option>
                    <option value={2}>Twenty</option>
                    <option value={3}>Thirty</option>
                    <option value={4}>Thirty</option>
                </NativeSelect>
                {/* <Button onClick={handleSubmit}>Add Activity</Button> */}
                {/* <Button onclick={props.changeSingupState}>Already a Member</Button> */}
            </FormControl>


            {/* <FormControl className={classes.margin}>
        <InputLabel id="demo-customized-select-label">username</InputLabel>
